    - tcp://223.5.5.5
    - tcp://8.8.8.8
    - tcp://1.1.1.1
    - udp://1.1.1.1
    - udp://223.6.6.6
    - udp://119.29.29.29
    - udp://8.8.8.8
    - udp://114.114.114.114
  fallback:
    - udp://223.5.5.5:853
    - https://223.5.5.5/dns-query
    - udp://1.0.0.1
    - udp://8.8.4.4
  fallback-filter:
    geoip: true
    geoip-code: ir
    ipcidr:
      - 240.0.0.0/4
    domain:
      - '+.google.com'
      - '+.facebook.com'
      - '+.youtube.com'
      - '+.telegram.com'
      - '+.instagram.com'

